sites.css:
/* GENERAL  */

:root {
  --primary: #337ab7;
  --primary-darker: #185284;
  --primary-light: #688dac;
  --green-job: #16a805;
  --radious: 4px;
}

body {
	background: #fff;
    color: #333;
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
}

a.link,
a:link,
.content a:link {
	color: var(--primary-light);
}

a:visited,
.content a:visited {
	color: var(--primary);
}

.footer {
	background: #fff;
}

/* menu */
.main-menu,
.main-menu li ul {
	background: #343434;
}
.main-menu li {
	padding: 0;
}
.main-menu a {
	color: white;
	font-weight: normal;
	display: inline-block;
	padding: 8px 24px;
}

.main-menu li ul li a {
	border: none;
	width: 100%;
}

.main-menu a:hover {
	color: white;
	background: #484848;
}

/* GENERAL FORMS */

.form {
	margin: 32px 0;
	border: 1px solid #efefef;
	background: #f9f9f9;
	padding: 16px;
	border-radius: var(--radious);
	box-shadow:
	 0px 0.1px 1.4px rgba(0, 0, 0, 0.035),
	0px 1px 11px rgba(0, 0, 0, 0.07)
	;
}

input.button,
button {
	height: 33px;
	font-size: 1.4rem;
	cursor: pointer;
    transition: all 0.2s ease;
    padding: 0 16px;
    border-radius: var(--radious);
    background: var(--primary);
    border: none;
    color: white;
    font-weight: normal;
}

input.button:hover {
	background: #999;
}

input.textarea,
input[type="text"] {
	font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
	font-size: 1.5rem;
	padding: 0 8px;
	height: 33px;
	border-radius: var(--radious);
	background: white;
	max-width: 100%;
}

.formselect {
	font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
}

select.formselect {
	height: 33px;
	font-size: 1.5rem;
}

option.formselect {
	font-size: 1.5rem;
}

/* Tables */
.dataTable caption {
	color: #333;
	font-size: 2.2rem;
	margin-bottom: 0;
	padding-bottom: 2px;
}

/* AIRPORT PAGE */
.content a[href^="http://www.gcmap"] img {
	display: none;
}

.tablesorter-default {
	font-size: 1.6rem;
	line-height: 2;
}

@media screen and (max-width: 1200px) {
	.tablesorter-default {
		font-size: 1.4rem;
		overflow-x:auto;
	}
}

div.airportInfo h1 {
	font-size: 3rem;
}
.airportInfo-data {
	padding-bottom: 16px;
	border-bottom: 1px solid #ccc
}

.airportInfo-keydata {
	padding: 16px;
	background: #f2f3f4;
}

.airportInfo-keydata div:nth-child(1) {
	font-weight: bold;
	font-size: 1.6rem;
	padding-bottom: 4px;
}

.airportInfo-keydata div:nth-child(2),
.airportInfo-keydata div:nth-child(3){
	font-size: 1.4rem;
	color: #999;
}

.airportInfo-local-carriers {
	padding-left: 16px;
	border-left: 1px solid #ccc;
}

.airportInfo-keydata .airportOps {
	padding: 0 0 16px;
	color: var(--primary);
}

#fboInfo thead td {
	background: #ccc;
	padding: 4px 16px 4px 4px;;
}

#fboInfo tbody td {
	background: #fff;
	border: 1px solid #f2f3f4;
	padding: 4px;
}

.airportInfo-fbo-space {
	padding: 8px 16px 32px;
}

.tablesorter-default .numeric {
	white-space: nowrap;
}

.tablesorter-default caption {
	font-size: 3rem;
	color: #333;
}

.tablesorter-default .header, .tablesorter-default .tablesorter-header {
	background: #f2f3f4 url(data:image/gif;base64,R0lGODlhFQAJAIAAACMtMP///yH5BAEAAAEALAAAAAAVAAkAAAIXjI+AywnaYnhUMoqt3gZXPmVg94yJVQAAOw==) no-repeat center right;
}

.tablesorter-default td {
	border: none;
	white-space: nowrap;
}

.tablesorter-default tr.odd td {
	background: #f2f3f4;
}

.tablesorter-default tr.even td {
	background: #fff;
}

.tablesorter-default tbody > tr.odd:hover > td,
.tablesorter-default tbody > tr.even:hover > td {
	background: #ccc;
	cursor: pointer;
}

.assigmentTable td font {
	color: var(--green-job);
}


#airportForm #addSelectedButton {
	background: var(--primary);
	color: white;
	transition: 0.2s ease all;
	border-radius: var(--radious);
	height: 33px;
	border: none;
	font-size: 1.6rem;
	padding: 0 16px;
	margin-bottom: 20px;
}

.updateCheckbox input.chkbox {
	transform: scale(1.3);
	margin-left: 10px;
	cursor: pointer;
}

.airport-search {
	width: 600px;
}

/* log tables */

div.dataTable {
	background: none;
	border: none;
	width: 100%;
}

.dataTable table {
	width: 100%;
}

.dataTable tr:nth-child(odd) {
	background: #f5f5f5;
}

.dataTable table th {
	background-color: #999;
	color: white;
	border-bottom: 1px solid #ccc;
	padding: 4px;
}

.tablesorter-default .tablesorter-header {
	background-color: #999;
	font-size: 1.5rem;
	padding: 8px 16px 8px 8px;
}

.dataTable table td {
	vertical-align: middle;
	padding: 0 4px;
}

.dataTable td a {
	background: var(--primary);
	height: 25px;
	display: inline-block;
	padding: 0 16px;
	border-radius: var(--radious);
	font-weight: bold;
	line-height: 25px;
	margin: 8px 0;
	color: white;
	transition: 0.2s all ease;
}

.dataTable td a:link {
	color: white;
}

.dataTable td a:visited {
	color: white;
	background: var(--primary-light);
}

.dataTable td a:hover {
	color: white;
	background: var(--primary-darker);
}

.table-pagination {
	border-top: 1px solid #ccc;
}

/* PERSONAL LOG */
.personal-log td {
	transition: none;
}

.personal-log > tbody > tr > td:nth-child(2) > a,
.personal-log > tbody > tr > td:nth-child(3) > a {
	background: none;
	color: var(--primary-darker);
	padding-left: 0;
	padding-right: 0;
}

/* AIRCRAFT page */
.aircraftTable select {
	height: 33px;
	padding: 0 8px;
	font-size: 1.4rem;
}

.aircraftTable option {
	font-size: 1.4rem;
}

/* FBO */
.fboTable tr td:nth-child(2) {
	white-space: nowrap;
}

.dataTable .fboTable td:nth-child(2) a:first-child {
	background: none;
}

/* MY flight */
.myflight h3,
.myflight p,
.myflight td,
.myflight label {
	color: #333;
}

/* Aircraft log */
.aircraft-log table {
	border: 1px solid #e5e5e5;
	box-shadow:
	 0px 0.1px 1.4px rgba(0, 0, 0, 0.035),
	0px 1px 11px rgba(0, 0, 0, 0.07)
	;
}

.aircraft-log table th,
.aircraft-log table td,
.aircraft-log-entries.dataTable th,
.aircraft-log-entries.dataTable td {
	padding: 4px 8px;
	text-align: left;
}

.aircraft-log-entries.dataTable td.numeric {
	text-align: right;
}

.aircraft-log-entries.dataTable tr table td {
	width: 50%;
}

.aircraft-log-entries.dataTable tr table td:nth-child(2) {
	text-align: right;
}

.aircraft-log table td {
	padding: 8px;
}

.fboTable.tablesorter-default tbody td {
	white-space: normal;
}

.fboTable.tablesorter-default tbody td:first-child {
	width: 35%;
}

.fboTable.tablesorter-default tbody td:first-child a {
	background: none;
	transition: none;
	color: var(--primary);
	font-weight: normal;
}

.fboTable.tablesorter-default tbody td:nth-child(2) {
	white-space: nowrap;
}


/* payment log */
.dataTable.payment-log tbody td:nth-child(8) a:first-child {
	background: none;
	padding: 0 8px 0 0 ;
}

/* gmap */
#map.gmaps {
	width: 100vw;
	height: 100vh;
}

